def get_odd_collatz(n: int) -> List[int]:
    if n <= 0:
        raise ValueError("n should be a positive integer.")
    if n == 1:
        return [1]
    odd_collatz = []
    while n > 1:
        if n % 2 == 1:
            odd_collatz.append(n)
        n = 3 * n + 1 if n % 2 else n // 2
    return odd_collatz
