def can_arrange(arr: List[int]) -> int:
    # Find the maximum element in the array
    max_element = max(arr)
    # Create a frequency table for the array
    freq_table = [0] * (max_element + 1)
    for element in arr:
        freq_table[element] += 1
    # Find the index of the first element which is not greater than or equal
    # to the element immediately preceding it
    for i in range(1, len(arr)):
        if arr[i] <= arr[i - 1]:
            return i
    return -1
