def int_to_mini_roman(number: int) -> str:
    if not isinstance(number, int) or number < 1 or number > 1000:
        raise ValueError("Invalid input")
    roman_numeral_map = [
        (1000, "m"),
        (900, "cm"),
        (500, "d"),
        (400, "cd"),
        (100, "c"),
        (90, "xc"),
        (50, "l"),
        (40, "xl"),
        (10, "x"),
        (9, "ix"),
        (5, "v"),
        (4, "iv"),
        (1, "i"),
    ]
    roman_numeral = ""
    for integer, roman_char in roman_numeral_map:
        while number >= integer:
            roman_numeral += roman_char
            number -= integer
    return roman_numeral.lower()
